import React from "react";

function Skills() {
  return (
    <section>
      <h2>Skills</h2>
      <ul>
        <li>JavaScript / TypeScript</li>
        <li>React.js</li>
        <li>Node.js</li>
        <li>HTML / CSS</li>
        <li>Git & Version Control</li>
      </ul>
    </section>
  );
}

export default Skills;
